import "./soil.css";

const soil = () => {
  return (
    <div className="soil-page">
      <div className="image-14">
      <div className="group-33885">
          <span className="home">HOME </span>
          <span className="services">SERVICES </span>
          <span className="about-us">ABOUTUS </span>
          <span className="contact"> CONTACT</span>
          </div><br></br><br></br>
        <div className="soil">SOIL</div>
        <div className="flex-container-1">
          <img className="image-15" src="https://i.pinimg.com/564x/e8/c2/bb/e8c2bbc2b8fbf6ad97d4daf572b1c47b.jpg" />
          <img className="image-16" src="https://i.pinimg.com/564x/19/7d/18/197d18703914933e6c20a4a63f7755f1.jpg" />
        </div>
        <div className="flex-container-2">
          <span>Soil Knowledge</span>
          <span>Soil Testing Lab</span>
        </div>
      </div>
    </div>
  );
};
export default soil;
